You need to add extra style to remove `border-radius` for cases when there is no compositor running. Like this:
```
gf-unlock-dialog.solid,
gf-unlock-dialog.solid frame border {
  border-radius: 0px;
}
```

Also please use `10px` as border radius, same as `gf-popup-window`.
